import Data.List(nub, sortBy)
import Data.Function(on)
import Data.Char(isLetter)
 
count' :: String -> Char -> Int
count' = foldr (\ e f x -> if x == e then succ (f x) else f x) (const 0)
 
count :: String -> [(Char,Int)]
count str = sort' $ nub $ zip str $ count' str `map` str
  where
    sort' = reverse . sortBy (compare `on` snd)

